import { Component, OnInit } from '@angular/core';
import { Link } from '../../interfaces/link';

@Component({
  selector: 'appHeader',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent implements OnInit {

  links: Array<Link>;
  authLinks: Array<Link>;
  constructor() {}

  ngOnInit(): void {
    this.links = [
      {
        label: 'Acceuil',
        url: '',
        icon: 'bx bx-home-alt text-xl',
        visible: true,
      },
      {
        label: 'Mes Cvs',
        url: '',
        icon: 'bx bx-id-card text-xl',
        visible: true,
      },
    ]
    this.authLinks = [

      {
        label: 'Se connecter',
        url: '',
        icon: 'bx bx-home-alt',
        visible: true,
      },
      {
        label: 'S\'inscrire',
        url: '',
        icon: 'bx bx-home-alt',
        visible: true,
      },
      {
        label: 'Se déconnecter',
        url: '',
        icon: 'bx bx-home-alt',
        visible: false,
      },
    ]
  }

}
